import React, { Component } from 'react'
import {Description} from '../../components/description';
import Checklist from '../../components/checklist';
import img1 from '../../assets/volcano-1.jpg';
import img2 from '../../assets/volcano-2.jpg';
class VolcanicEruption extends Component {
  render() {
    return (
      <div>
       <Description title="VOLCANIC ERUPTION" link={"/"} img1={img1} img2={img2}
                    description="A volcano is an opening on the surface of a planet or moon that allows material warmer than its surroundings to escape from its interior. When this material escapes, it causes an eruption. An eruption can be explosive, sending material high into the sky. Or it can be calmer, with gentle flows of material." 
                    description2= "These volcanic areas usually form mountains built from the many layers of rock, ash or other material that collect around them. Volcanoes can be active, dormant, or extinct. Active volcanoes are volcanoes that have had recent eruptions or are expected to have eruptions in the near future. Dormant volcanoes no longer produce eruptions, but might again sometime in the future. Extinct volcanoes will likely never erupt again."
                      />
        <Checklist title="My Checklist"
                  list_id="volcanicEruption"
                  />
        </div>
      )
  }
}

export default VolcanicEruption
